import logo from './logo.svg';
import React, { Component } from 'react'
import Headers from './Headers'
import Body from './Body'
import Footers from './Footers'
import './App.css';
import axios from "axios";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";


class home extends Component {
  constructor(props) {
    super(props);

    this.state = {
      profil: "visiteur",
      dataInit: []
    }
    this.allResults = this.allResults.bind(this);
  }
    /*allResults() {
      var b = document.querySelector("header");
      b.setAttribute("padding-top", "0%");
      axios.get ("http://localhost:5000/").then(res => {
        this.setState({dataInit: res.data.data}) 
      });
    }*/
    autocompleteCity() {
      var options = {
       types: ['(cities)'],
       componentRestrictions: {country: "us"}
      };
      var input = document.getElementById('searchTextField');
      var autocomplete = new google.maps.places.Autocomplete(input, options);
     }
    

    render() {
      const {profil, dataInit} = this.state
      return (
        <div className="App">
          <Headers profil={profil} where={"home"}/>
          <Body profil={profil} project={dataInit} autocompleteCity={this.allResults} onChangeLiked={this.handleSelectedChange}/>
          <Footers profil={profil}/>
        </div>
      )
    }
  }

export default home;
